public boolean equals(Object other) {
  if (!(other instanceof DataChecksum)) {
    return false;
  }
  DataChecksum o = (DataChecksum)other;
  return o.bytesPerChecksum == this.bytesPerChecksum &&
    o.type == this.type;
}
